import React, {Fragment} from 'react';
import BuyStock from '../stocks/BuyStock';

const Portfolio = () => {
  return (
    <div className='grid-2-cols'>
      <h1>Portfolio</h1>
      <div className='wrapper'>
        <div className='vert-line' />
        <BuyStock />
      </div>
    </div>
  );
};

export default Portfolio;
